#define decryption window
def dec():
    root1=tk.Toplevel(root)
    root1.geometry("550x150")
	#decryption function
    def Decrypt_Image():
        file_path=filepath_entry.get()
        password=password_entry.get()
        if file_path=='':
             messagebox.showerror("Error", "Please select a file to decrypt.")
             return
        if password == '':
            messagebox.showerror("Error", "Please Enter a password")
            return
        else:
            try:
               #Open the encrypted image file and read the IV and encrypted data 
               with open(file_path, 'rb') as f:
                   iv=f.read(16)
                   encrypted_data=f.read()
               key=password.encode()

                #Initialize the cipher with the key and IV 
               cipher=AES.new(key, AES.MODE_CBC, iv)

               #Decrypt the data and unpad it
               decrypted_data=unpad(cipher.decrypt(encrypted_data), AES.block_size)
               #Save the decrypted data as an image file
               with open(file_path, 'wb') as f:
                    f.write(decrypted_data)

               messagebox.showinfo("Info", "Image decrypted successfully.")
            except ValueError:
                messagebox.showinfo("Info", "Image Already decrypted successfully.")

	#decrypting filepath    
    def file_path():
        fp=filedialog.askopenfilename()
        filepath_entry.delete(0,tk.END)
        filepath_entry.insert(0,fp)
    frame=tk.Frame(root1)
